/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "iterator"
    }}>{`Iterator`}</h1>
    <p>{`A behavioural pattern that is used to access the elements of a collection object in sequential manner without a required understanding of the underlying representation.`}</p>
    <h2 {...{
      "id": "components"
    }}>{`Components`}</h2>
    <ul>
      <li parentName="ul">{`ConcreteIterator: An interface to define how the `}<inlineCode parentName="li">{`next`}</inlineCode>{` and `}<inlineCode parentName="li">{`hasNext`}</inlineCode>{` methods work.`}</li>
      <li parentName="ul">{`ConcreteCollection: A collection that has knowledge of the iterator and creates the iterator.`}</li>
    </ul>
    <h2 {...{
      "id": "example"
    }}>{`Example`}</h2>
    <p>{`In this basic example below, we will create a `}<inlineCode parentName="p">{`ConcreteCollection`}</inlineCode>{` and `}<inlineCode parentName="p">{`ConcreteIterator`}</inlineCode>{` class to demonstrate how the `}<inlineCode parentName="p">{`Iterator`}</inlineCode>{` design pattern works.`}</p>
    <p>{`Note that after create a collection, we can use the `}<inlineCode parentName="p">{`createIterator`}</inlineCode>{` method as many times as we want to return seperate instances of an `}<inlineCode parentName="p">{`iterator`}</inlineCode>{` - for demonstration purposes, we will create a second iterator to do just that.`}</p>
    <p>{`The last part of `}<inlineCode parentName="p">{`"main"`}</inlineCode>{` will demo what happens when you intertwine iterator calls.`}</p>
    <p>{`Check the logs for results.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`interface Iterator<T> {
  next(): T;
  hasNext(): boolean;
}

interface Collection {
  createIterator(): Iterator<Number>;
}

class ConcreteIterator implements Iterator<Number> {
  private _collection: Number[];
  private _index: number = 0;

  constructor(newCollection: Number[]) {
    this._collection = newCollection;
  }

  next(): any {
    const result = this._collection[this._index];
    this.log();
    this._index += 1;
    return result;
  }

  hasNext(): boolean {
    return this._index < this._collection.length;
  }

  private log(): void {
    console.log(\`Method called during index: \${this._collection[this._index]}\`);
  }
}

class ConcreteCollection implements Collection {
  private _collection: Number[] = [];

  constructor(collection: Number[]) {
    this._collection = collection;
  }

  createIterator(): Iterator<Number> {
    return new ConcreteIterator(this._collection);
  }
}

(function main() {
  const collection: ConcreteCollection = new ConcreteCollection([0, 1, 2, 3]);
  const iterator: Iterator<Number> = collection.createIterator();
  const secondIterator: Iterator<Number> = collection.createIterator();

  while (iterator.hasNext()) {
    const number: Number = iterator.next();
    console.log(\`Logging: \${number.valueOf()}\`);
  }

  while (secondIterator.hasNext()) {
    const number: Number = secondIterator.next();
    console.log(\`Second Iterator Logging: \${number.valueOf()}\`);
  }

  // third and fourth iterators intertwined
  const thirdIterator: Iterator<Number> = collection.createIterator();
  const fourthIterator: Iterator<Number> = collection.createIterator();

  console.log('thirdIterator', thirdIterator.next());
  console.log('thirdIterator', thirdIterator.next());
  console.log('thirdIterator', thirdIterator.next());
  console.log('fourIterator', fourthIterator.next());
  console.log('fourIterator', fourthIterator.next());
  console.log('fourIterator', fourthIterator.next());
  console.log('fourIterator', fourthIterator.next());
  console.log('thirdIterator', thirdIterator.next());
})();
`}</code></pre>
    <h2 {...{
      "id": "resources"
    }}>{`Resources`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://en.wikipedia.org/wiki/Iterator_pattern"
        }}>{`Wikipedia`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.tutorialspoint.com/design_pattern/iterator_pattern.htm"
        }}>{`Tutorials Point`}</a></li>
    </ul>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
